import React from "react";
import { Link } from "react-router-dom";

const Houses = () => {
  return (
    <div>
      <h1>Hogwarts Houses</h1>
      <ul className="houses-list">
        <li className="houses-logo">
          <Link to="/house/gryffindor">
            <img src="https://i.imgur.com/rEMB78b.png" alt="" />
          </Link>
        </li>
        <li className="houses-logo">
          <Link to="/house/hufflepuff">
            <img src="https://i.imgur.com/xvYTsM0.png" alt="" />
          </Link>
        </li>
        <li className="houses-logo">
          <Link to="/house/ravenclaw">Ravenclaw</Link>
        </li>
        <li className="houses-logo">
          <Link to="/house/slytherin">Slytherin</Link>
        </li>
      </ul>
    </div>
  );
};

export default Houses;
